import React, {Component} from 'react';
import './layout.css';

class Menu extends Component{
  render(){
    return(
      <div className="MuiDrawer-root MuiDrawer-docked"> 
        <div className="MuiPaper-root MuiDrawer-paper jss320 MuiDrawer-paperAnchorLeft MuiDrawer-paperAnchorDockedLeft MuiPaper-elevation0">
        </div>
      </div>
    );
  }
}

export default Menu;
